import React from "react";
import { Route, Switch } from "react-router-dom";
import SignIn from './containers/SignIn';
import SignUp from './containers/SignUp';
import Home from './containers/Home';

import * as firebase from "firebase/app";
import "firebase/auth";

var firebaseConfig = {
  apiKey: "AIzaSyDNsKY3PSvEWZZnCJg6l0bQjyU-o0hIbIU",
  authDomain: "lenow-webwinter.firebaseapp.com",
  databaseURL: "https://lenow-webwinter.firebaseio.com",
  projectId: "lenow-webwinter",
  storageBucket: "lenow-webwinter.appspot.com",
  messagingSenderId: "1019623637173",
  appId: "1:1019623637173:web:80ea739546aaf0665f7efc",
  measurementId: "G-N8RMM6LNPZ"
};

// Initialize Firebase
firebase.initializeApp(firebaseConfig);
// console.log(firebase);

export default function Routes() {
  return (
    <Switch>
      <Route path="/" exact>
        <SignUp firebase={firebase}/>
      </Route>
      <Route path="/sigin" exact>
        <Home/>
      </Route>
      <Route path="/signup" exact>
        <SignIn firebase={firebase}/>
      </Route>
    </Switch>
  );
}
